import React, { Component} from 'react';

class Hello extends Component
{
    render()
    {
        console.log(this.props);
        return(
            <div className="hello">
                <h1>
                    My FIRST REACT App!!
                    
                </h1>
                <h2>
                    Name: {this.props.name} age: {this.props.age} About: {this.props.about}
                </h2>
            </div>
        );
    }
}

export default Hello;
